--
-- Name: _partial_view_10; Type: VIEW; Schema: _timescaledb_internal; Owner: dotonkovic
--

CREATE VIEW _timescaledb_internal._partial_view_10 AS
 SELECT public.time_bucket('00:30:00'::interval, ts) AS ts,
    public.first(open, ts) AS open,
    max(high) AS high,
    min(low) AS low,
    public.last(close, ts) AS close,
    sum(volume) AS volume
   FROM public.btc_ohlcv
  WHERE (timeframe = '1m'::text)
  GROUP BY (public.time_bucket('00:30:00'::interval, ts));


